Pages from the journal @missellemusic and I created on our desert wanderings a few weeks ago. 

We drew inspiration from found objects, desert plants, sunrises and starry nights. Elle’s music set a rhythm for the trip: her words woven throughout the journal and her song reverberating into the night sky. On rainy days, we roamed around taking polaroids of patterns in the moss and any other thing that drew our attention. We even made a desert trash page, repurposing an old beer can and an old random Polaroid we found (would love to know the story behind that photo). 

Something about it reminded me of projects I did when I was a kid. Art driven by a sense of playfulness and curiosity.

