It has taken me some time to let my mind untwist from my time in the Charakusa Valley. 🇵🇰

To be living in these mountains for four weeks was an honor and it affected me in a big way. I feel like I harnessed enough gratitude for a lifetime. The nature of the climbing was very much what I seek: wandering and wild, full of character and beauty.

The challenges were in the day to day, figuring out how to work in a team of four and navigating those complexities, everything exaggerated against the raw landscape. It was painful at times, but also expansive. You expect these trips to be about the rock and the weather, but they move you far beyond that.

It rained almost every day, but that made those days we got to climb extra special. We put up a route on the west face of Naisa Brakk, the most symmetrical pyramid of a peak. The route links into the southwest ridge, originally established by @stevehouse10 @icevince and Marco Prezelj. 

On one of the last days of the trip a few of us climbed a beautiful satellite peak of k6. It was a spire that topped out at 17,600 ft that I had been looking at every day of the four weeks we were there, the dark rock so striking against the snow and ice of K6 . 

I took a lot of photos and made a lot of art that I’m still sorting through and will continue to share as the untwisting continues!

