Painting outside is such a freeing way to create. My personal practice is to be playful with my plein air paintings, really immerse in the landscape and let the experience lead me. I’m really so excited and honored to share this process with the participants of FORMS workshop in Bishop CA, Nov 3rd - 5th. 

Jaclyn (@uzumaticeramics) who is such a master of her craft, will be teaching pottery. Her work explores connection between people and wild places. In her workshop, you will create a functional drinking vessel with just your two hands, a slab of clay, and a few simple tools! 

Along with all the making, we’ll get to play on the boulders, hit the brewery and share a home cooked meal. It’s going to be  a really beautiful weekend, and I hope you can join! 

